import { InfoService } from './info.service'
import MemberCard from '@/views/biz-components/h5/pages/member-card'
import H5Container from '@/views/biz-components/h5/h5-container'
import { MEMBER_CARD } from '@/views/biz-components/h5/pages/member-card.config'
import {
  ADMISSION_RANGE,
  PRICE_SETTING,
  SUPPORT_SALES,
  SELL_STATUS,
  ACTIVATE_TYPE,
  SHELF_STATUS,
  COURSE_INTERESTS,
  INOUT_TYPE
} from '@/constants/card/member'
import {
  weekList,
  shop_columns,
  price_gradient_columns,
  courses_columns
} from './info.config'
export default {
  name: 'PageShopPeriodCardInfo',
  bem: {
    item: 'shop-card'
  },
  components: {
    MemberCard,
    H5Container
  },
  serviceInject() {
    return {
      infoService: InfoService
    }
  },
  rxState() {
    return {
      cardInfo: this.infoService.cardInfo$
    }
  },
  data() {
    return {
      // week
      ACTIVATE_TYPE,
      SHELF_STATUS,
      INOUT_TYPE,
      COURSE_INTERESTS,
      ADMISSION_RANGE,
      PRICE_SETTING,
      SUPPORT_SALES,
      SELL_STATUS,
      MEMBER_CARD,
      weekList,
      // 门店表头
      shop_columns,
      // 售卖定价表头
      price_gradient_columns,
      // 约课权益表头
      courses_columns
    }
  }
}
